(5, NULL, 'تويوتا كامري 2024', 'Toyota Camry 2024', 106500.00, 103500.00, 1, 0, '22at-DtFCCQ', 1, 1, 7, 6, 10, 4, 0, 2025, 2500, 'automatic', 'sedan', 'saudi', 1, 'المحرك: 2.5 لتر، 4-اسطوانات \r\nالقوة القصوى: 204 حصان / 6600 د.د\r\nالعزم الأقصى 243 ن.م / 4000 - 5000 د.د\r\nناقل حركة أوتوماتيكي بـ 8 سرعات \r\nمقاس الإطارات: 205/65R16\r\nالأبعاد طول - عرض - ارتفاع (مم): 4885 - 1840 - 1445\r\nكفاءة استهلاك الوقود : 18.3 كم/ لتر\r\nسعة خزان الوقود: 60 لتر\r\nالمزايا الخارجية\r\n\r\nجنوط ألمونيوم مقاس16بوصة (صنع في تايلاند) *\r\nأنوار امامية ال اي دي (LED) \r\nأنوار نهارية إلـ إي دي \"DRL\"\r\nمرايات جانبية كهربائية, بلون السيارة مزودة بإشارات انعطاف, قابلة للطي يدويا\r\nغطاء عادم مطلي بالكروم (صنع في الصين)*\r\nالمزايا الداخلية\r\n\r\nمقاعد من القماش\r\nمقود يوريثين ثلاثي مع ازرار تحكم في النظام الصوتي على المقود\r\nمكيف بتحكم يدوي + فتحات تكييف خلفية\r\nمقاعد خلفية قابلة للطي (40:60) مع مسند وسطي بحامل أكواب\r\nالنظام الصوتي والترفيهي\r\n\r\nنظام صوتي بشاشة لمس 7 بوصة مع بلوتوث (صنع في الصين )*\r\nنظام Apple CarPlay *\r\nمنفذ USB\r\n6 سماعات\r\nمزايا الأمان و الراحة\r\n\r\nوسائد هوائية أمامية للسائق و الراكب الامامي\r\nالدخول بدون مفتاح \"ريموت كونترول\"\r\nكاميرا خلفية (صنع في الصين )*\r\nحساسات أمامية وخلفية للمساعدة على الوقوف (صنع في الصين)*\r\nمثبت سرعة\r\nشاحن لاسلكي للهواتف الذكية (المتوافقة)(صنع في تايوان)*\r\nمكابح وقوف كهربائية ( EPB) + خاصية الوقوف المؤقت\r\nمنبه فاخر (بوري) (صنع في إندونيسيا )*\r\nفرشات أرضية من القماش (صنع في تايلاند)*\r\nحقيبة اسعافات أولية (صنع في الصين)*\r\nملصق نوع الوقود (صنع في جنوب أفريقيا)*', 'المحرك: 2.5 لتر، 4-اسطوانات \r\nالقوة القصوى: 204 حصان / 6600 د.د\r\nالعزم الأقصى 243 ن.م / 4000 - 5000 د.د\r\nناقل حركة أوتوماتيكي بـ 8 سرعات \r\nمقاس الإطارات: 205/65R16\r\nالأبعاد طول - عرض - ارتفاع (مم): 4885 - 1840 - 1445\r\nكفاءة استهلاك الوقود : 18.3 كم/ لتر\r\nسعة خزان الوقود: 60 لتر\r\nالمزايا الخارجية\r\n\r\nجنوط ألمونيوم مقاس16بوصة (صنع في تايلاند) *\r\nأنوار امامية ال اي دي (LED) \r\nأنوار نهارية إلـ إي دي \"DRL\"\r\nمرايات جانبية كهربائية, بلون السيارة مزودة بإشارات انعطاف, قابلة للطي يدويا\r\nغطاء عادم مطلي بالكروم (صنع في الصين)*\r\nالمزايا الداخلية\r\n\r\nمقاعد من القماش\r\nمقود يوريثين ثلاثي مع ازرار تحكم في النظام الصوتي على المقود\r\nمكيف بتحكم يدوي + فتحات تكييف خلفية\r\nمقاعد خلفية قابلة للطي (40:60) مع مسند وسطي بحامل أكواب\r\nالنظام الصوتي والترفيهي\r\n\r\nنظام صوتي بشاشة لمس 7 بوصة مع بلوتوث (صنع في الصين )*\r\nنظام Apple CarPlay *\r\nمنفذ USB\r\n6 سماعات\r\nمزايا الأمان و الراحة\r\n\r\nوسائد هوائية أمامية للسائق و الراكب الامامي\r\nالدخول بدون مفتاح \"ريموت كونترول\"\r\nكاميرا خلفية (صنع في الصين )*\r\nحساسات أمامية وخلفية للمساعدة على الوقوف (صنع في الصين)*\r\nمثبت سرعة\r\nشاحن لاسلكي للهواتف الذكية (المتوافقة)(صنع في تايوان)*\r\nمكابح وقوف كهربائية ( EPB) + خاصية الوقوف المؤقت\r\nمنبه فاخر (بوري) (صنع في إندونيسيا )*\r\nفرشات أرضية من القماش (صنع في تايلاند)*\r\nحقيبة اسعافات أولية (صنع في الصين)*\r\nملصق نوع الوقود (صنع في جنوب أفريقيا)*', 'gasoline', '2', NULL, 1, 1, 'webstdy_171076958245_BACK_LE_WHEELS_5202-1.jpg', '2024-03-11 11:51:35', '2024-08-12 07:15:29', NULL, 249),
