p (Made in China)*\r\nInternal advantages\r\n\r\nCloth seats\r\nThree-way urethane steering wheel with audio system control buttons on the steering wheel\r\nManually controlled air conditioning + rear air conditioning vents\r\nFolding rear seats (40:60) with center armrest with cup holder\r\nAudio and entertainment system\r\n\r\n7-inch touch screen audio system with Bluetooth (Made in China)*\r\nApple CarPlay*\r\nUSB port\r\n6 headphones\r\nSafety and comfort features\r\n\r\nFront airbags for the driver and front passenger\r\nKeyless entry (remote control)\r\nRear camera (Made in China)*\r\nRear parking sensors (Made in China)*\r\nCruise control\r\nElectric parking brake (EPB) + temporary parking feature\r\nLuxury Alarm Clock (Puri) (Made in Indonesia)*\r\nFabric floor mats (Made in Thailand)*\r\nFirst aid bag (Made in China)*\r\nFuel type sticker (Made in South Africa)*', 'gasoline', '2', NULL, 1, 1, 'webstdy_171077014545_BACK_LE_PLASTIC_WHEELS_5223.jpg', '2024-03-18 13:55:45', '2024-08-01 09:50:46', NULL, 48),
