INSERT INTO `faqs` (`id`, `question`, `answer`, `created_at`, `updated_at`) VALUES
(3, '1- من كود كار باختصار', 'منصة كود كار هي موقع و وسيط رقمي نختص في بيع وشراء وتمويل السيارات كافة', '2024-03-14 21:08:14', '2024-04-13 04:28:43'),
(4, '2- ماهي الخدمات التي نقدمها لعملائنا', 'نقدم خدمات متعددة كتمويل السيارات بنظام التاجير المنتهي بالتمليك عن طريق البنوك والشركات السعودية - وخدمة الإعلان عن سيارتك على موقعنا - او خدمة تصفح وشراء السيارات بطرق حديثة', '2024-03-14 21:38:21', '2024-04-13 04:28:55'),
(5, '3- هل أستيطع الإعلان عن سيارتي على موقعكم ؟', 'كود كار سمحت لكل من يرغب أن يعلن عن سيارته سواء بيع او شراء سيارة من خلال الموقع وفق شروط يسمح بها موقعنا\r\nراجع الشروط والأحكام لسياسة الموقع https://www.codecar.com.sa/terms', '2024-03-14 21:41:48', '2024-04-13 04:29:09'),
(6, '4- هل توجد اي رسوم مالية مقابل الإعلان على موقعكم .!', 'كود كار حالياً لاتفرض اي رسوم مالية او رسوم إشتراكات \r\nعلى الأعلان في الموقع .', '2024-03-14 21:43:47', '2024-04-13 04:29:24'),
(7, '5- ماهي شروط تقديم طلب تمويل سيارة', 'أن تكون سعودي او مقيم موظف ولديك راتب محول الى البنك وعمرك من 21 سنة وأكثر .', '2024-03-16 11:56:28', '2024-04-13 04:29:36'),
(8, '6-هل يوجد لديكم معرض سيارات', 'نعم لدينا معرض سيارات ونتشرف بزيارتكم\r\nالرياض . معارض القادسية . شارع وادي اللجام\r\nمعرض كود كار للسيارات .', '2024-03-16 12:01:54', '2024-04-13 04:29:55'),
(9, '7- كيف اعرف أي جهة تمويل هي أقل هامش ربح .!', 'لاتشيل هم .\r\nقمنا بتطوير حاسبة تمويلية حديثة تظهر لك جميع عروض البنوك وجهات التمويل وأيهم أقل هامش ربح وأيهم يناسب وضعك الائتماني . ادخل فقط بيناتك الشخصية والمالية وابحث وراح نظهر لك جميع العروض بضغطة زر وحدة', '2024-03-16 12:06:07', '2024-04-13 04:30:10'),
(10, '8- كم تستغرق الموافقة للطلب', 'يتم الرد على طلبك بالقبول او الرفض خلال ٢٤ ساعة من تقديم الطلب عدا ايام الجمعة', '2024-03-16 12:08:18', '2024-04-13 04:30:24'),
(11, '9 - مدة استلام السيارة .؟', 'يتم تجهيز السيارة بعد ٤٨ ساعة من الموافقة على طلبك من قبل جهة التمويل', '2024-03-16 12:09:32', '2024-04-13 04:30:37'),
(12, '10- هل يوجد شحن للسيارة خارج الرياض', 'نعم يوجد شحن لسيارتك لجميع مناطق المملكة بالتعاون مع عدة شركات شحن معتمدة لدينا .', '2024-03-16 12:11:26', '2024-04-13 04:30:50'),
(13, '11- ماهو أقل راتب يسمح له بالتمويل', '3.500 ريال هو أقل راتب يسمح له بالتمويل بعد خصم مبلغ التأمينات الإجتماعية ( صافي راتب )', '2024-03-16 12:13:26', '2024-04-13 04:30:59'),
(14, '12- ماهي أنواع التمويل التي تقدمونها .', 'كود كار موقع يختص بتقديم خدمات تمويل السيارات للأفراد والشركات عن طريق جهات تمويل متعددة وهو يقوم بدور وسيط رقمي بين العميل وجهات التمويل .', '2024-03-16 12:18:24', '2024-04-13 04:31:12'),
(15, '13- هل كود كار موثق في وزارة التجارة  .؟', 'نعم \"\r\nنحن موثقون في وزارة التجارة برقم سجل تجاري\r\n1010884436', '2024-03-16 12:21:17', '2024-04-13 04:31:22'),
(16, '14- هل يوجد تمويل للسيارات المستعملة ؟', 'التمويل التأجيري لايشمل السيارات المستعملة فقط السيارات الجديدة', '2024-03-21 21:20:01', '2024-04-13 04:31:37'),
(18, '15- اشتريت سيارة تأجير منتهي بالتملك وتعثرت في بعض الشهور هل أتواصل معكم لتأجيل الأقساط أو إعادة السيارة .!', 'كل الإجراءات الخاصة بالتمويل والأقساط تكون بين مستخدم السيارة وجهة التمويل.يمكنك مراجعة جهة التمويل التي تم توقيع العقد معها لخدمتك بهذا الخصوص.', '2024-04-13 04:24:10', '2024-04-13 04:31:52'),
(19, '16- أبحث عن سيارة ولم أجدها في السيارات المعروضة بالموقع هل يمكنكم توفيرها ؟', 'نعم يمكننا توفير أي نوع من السيارات في حال توفرها لدى الوكيل الرئيسي ,يرجى التواصل معنا على الرقم الموحد 920009183\r\n\r\nأو قم بتعبئة نموذج طلب الشراء وسنقوم بخدمتك', '2024-04-13 04:25:48', '2024-04-13 04:32:04');
