(2, 1, 'عطلة العيد', 'السلام عليكم ورحمه الله وبركاته\n- السادة منسوبي شركة \" كود كار للسيارات \" تحية طيبة وبعد .\nبمناسبة عيد الفطر السعيد أعاده الله عليكم ياليمن والقبول وتقبل منكم صيامكم وقيامكم \nتبدأ إجازة العيد من يوم الأثنين الموافق 2024/04/08 وتنتهي يوم السبت الموافق 2024/04/13\n( حيث يبدأ الدوام الرسمي يوم الاحد الموافق 2024/03/14 )\n\nوّكّلّ عّاّمّ وّاّنّتّ بّخّيّرّ ..\n\nمدير المبيعات - إبراهيم عبدالله', 1, '2024-04-03 18:30:16', '2024-04-05 18:59:00'),
(12, 20, 'تعميم اجازة عيد الاضحى', 'كل عام وانتم بالف خير  \nنود ابلاغكم بأن إجازة عيد الأضحى سوف نهاية دوام يوم الخميس  \nوتكون العودة صباح  يوم الخميس القادم', 1, '2024-06-12 15:49:23', '2024-06-12 15:49:30'),
(13, 24, 'تارقت مبيعات الموظفين لشهر  يوليو ( 7 ) 2024', 'الأخوة موظفي مبيعات كود كار المحترمين ..\r\nالسلام عليكم ورحمه الله وبركاته\r\nمرفق لكم تفاصيل تارقت مبيعات الموظفين لشهر 7 ميلادي من العام 2024 حسب شريحة المبيعات\r\nعلماً ان أي موظف تكون مبيعاته أقل من 5 سيارات لايتم صرف اي عمولة له .\r\n\r\n- ( الشريحة الأولى )\r\n* عدد السيارات 5 - عمولة السيارة 250 ريال لكل سيارة\r\n- ( الشريحة الثانية )\r\n* عدد السيارات 7 - عمولة السيارة 300 ريال لكل سيارة\r\n- ( الشريحة الثالثة )\r\n* عدد السيارات 9 - عمولة السيارة 350 ريال لكل سيارة\r\n- ( الشريحة الرابعة )\r\n* عدد السيارات أعلى من 9 سيارات عمولة السيارة 500 ريال لكل سيارة \r\n----------------------------------------------------------------\r\nمع كل التوفيق والنجاح للجميع .\r\n\r\nمدير المبيعات - ابراهيم عبدالله', 1, '2024-06-29 19:19:23', '2024-06-29 19:23:11');
