INSERT INTO `news` (`id`, `title_ar`, `title_en`, `highlighted_news`, `highlighted_image`, `main_image`, `description_ar`, `description_en`, `created_at`, `updated_at`) VALUES
(2, 'جيتور T2: مغامرة لا حدود لها', 'Gator T2: Limitless Adventure', 1, NULL, 'webstdy_1710108321JETOUR_T2_Set_for_International_Debut_at_Riyadh_Motor_Show.jpg', 'في حدث استثنائي أقيم وسط أجواء صحراوية فاخرة، كشفت شركة التوريدات الوطنية، الوكيل الحصري لعلامة جيتور في المملكة العربية السعودية، عن أحدث إصداراتها: جيتور T2. تأتي هذه السيارة كأول سيارة دفع رباعي من جيتور، لتُعزز مكانتها كعلامة تجارية رائدة في مجال التصاميم الراقية والتكنولوجيا المتطورة.\r\n\r\nتتميز جيتور T2 بمزيج فريد من القوة والأناقة، حيث يُجسد تصميمها الانسيابي اندماجًا مثاليًا بين القوة والرشاقة، مما يجعلها تبرز عن جميع المنافسين. وتُضفي خطوطها الجريئة وجودة صناعتها العالية مظهرًا مُلفتًا يجذب الأنظار أينما حلت.\r\n\r\nمواصفات استثنائية لقيادة استثنائية:\r\nتُلبي جيتور T2 احتياجات عشاق القيادة على الطرق الوعرة، بفضل محركها القوي بسعة 2.0 ليتر تيربو، وعزم دورانه الذي يصل إلى 390 نيوتن، ونظام الدفع الرباعي المتقدم بخاصية XWD. كما تُزود السيارة بمجموعة من الميزات التقنية المتطورة، مثل الكاميرا البانورامية بزاوية 450 درجة، ونظام X MODE، ونظام الحفاظ على المسار، ونظام التوقف عند الضرورة.\r\nتصميم داخلي فخم:\r\nتُكمل جيتور T2 إطلالتها الخارجية الفريدة بتصميم داخلي فخم، يتميز بإطارات ألمنيوم بقياس 20 بوصة، ونظام قفل الشنطة بالشفط. كما تُزود السيارة بشاشة وسطية ضخمة بقياس 15.6 بوصة مع خاصية ابل كار بلاي، ونظام صوتي فاخر من سوني يضم 11 سماعة، وإضاءة محيطية بألوان متعددة، وفتحة سقف بانورامية.\r\n\r\nالقيادة بأمان وثبات:\r\nتُولي جيتور T2 أهمية قصوى للسلامة، حيث تُزود بست وسائد هوائية ونظام Auto Hold للمساعدة على القيادة بأمان وثبات.', 'In an exceptional event held in a luxurious desert setting, National Supplies Company, the exclusive agent for the Jetour brand in the Kingdom of Saudi Arabia, unveiled its latest release: Jetour T2. This car comes as the first SUV from Jetour, strengthening its position as a leading brand in the field of high-end designs and advanced technology.\r\n\r\nJetour T2 features a unique blend of power and elegance. Its streamlined design embodies the perfect fusion of power and agility, making it stand out from all competitors. Its bold lines and high-quality craftsmanship create a striking appearance that attracts attention wherever it goes.\r\n\r\nExceptional specifications for exceptional driving:\r\nJetour T2 meets the needs of off-road enthusiasts, thanks to its powerful 2.0-liter turbo engine, 390 Nm of torque and advanced XWD all-wheel drive system. The car is also equipped with a set of advanced technical features, such as a 450-degree panoramic camera, the X MODE system, a lane keeping system, and a stopping system when necessary.\r\nLuxurious interior design:\r\nThe Jetour T2 complements its unique exterior with a luxurious interior design, featuring 20-inch aluminum wheels and a suction cup trunk locking system. The car is also equipped with a huge 15.6-inch central screen with Apple CarPlay, a luxurious audio system from Sony that includes 11 speakers, ambient lighting in multiple colors, and a panoramic sunroof.\r\n\r\nDriving safely and stably:\r\nJetour T2 attaches utmost importance to safety, as it is equipped with six airbags and an Auto Hold system to help drive safely and stably.', '2024-03-10 22:05:21', '2024-03-10 22:05:21'),
(3, 'استدعاء 41 سيارة لوسيد في السعودية', '41 Lucid cars recalled in Saudi Arabia', 1, NULL, 'webstdy_1710108555KSA-EPK.jpg', '3 طرازات قيد الاستدعاء من لوسيد بالسعودية\r\nكشفت وزارة التجارة في المملكة العربية السعودية عن استدعاء جديد للسيارات في المملكة. وتضمن الاستدعاء عدد 41 سيارة من طرازات لوسيد من الاصدارات التالية موديلات 2023 و2024 :\r\n\r\nلوسيد أير بيور.\r\n\r\nلوسيد اير جراند تورينج.\r\n\r\nلوسيد اير دريم. \r\n\r\n \r\n\r\nسبب استدعاء سيارات لوسيد بالسعودية\r\nكما أعلنت الوزارة عن سبب الاستدعاء بسبب خلل في نظام البرمجة للمركبة قد يؤدي إلى فقد قوة المحرك أثناء القيادة دون سابق إنذار، مما يزيد من احتمالية خطر وقوع حادث.\r\n\r\n \r\n\r\nتحديث لسيارات لوسيد في السعودية لحل مشكلة\r\nوطالبت وزارة التجارة بضرورة التحقق من شمول رقم هيكل المركبة في الاستدعاء. كما طالبت بضرورة التواصل مع شركة لوسيد موتورز في حال صعوبة تثبيت التحديثات اللازمة والتي تتضمن تثبيت التحديث عن بعد OTA دون الحاجة لزيارة الشركة.', '3 models under recall from Lucid in Saudi Arabia\r\nThe Ministry of Commerce in the Kingdom of Saudi Arabia revealed a new recall of cars in the Kingdom. The recall included 41 Lucid cars from the following versions, 2023 and 2024 models:\r\n\r\nLucid Air Pure.\r\n\r\nLucid Air Grand Touring.\r\n\r\nLucid Air Dream.\r\n\r\n \r\n\r\nThe reason for recalling Lucid cars in Saudi Arabia\r\nThe Ministry also announced the reason for the recall due to a defect in the vehicle’s programming system that may lead to a loss of engine power while driving without warning, which increases the risk of an accident.\r\n\r\n \r\n\r\nUpdate for Lucid cars in Saudi Arabia to solve a problem\r\nThe Ministry of Commerce demanded that it be verified that the vehicle’s chassis number is included in the recall. It also called for the need to contact Lucid Motors in the event of difficulty installing the necessary updates, which includes installing the update remotely (OTA) without the need to visit the company.', '2024-03-10 22:09:15', '2024-03-10 22:09:15'),
(4, 'أكثر 10 سيارات بيك أب مبيعاً في السعودية في 2023', 'The 10 best-selling pickup cars in Saudi Arabia in 2023', 1, NULL, 'webstdy_1710108786Pick-Up-Car.jpg', 'اعلان ترتيب البيك أب السعودي\r\nبعد الاعلان عن أكثر السيارات السيدان مبيعاً في السعودية في عام 2023 , وأكثر السيارات متعددة الاستخدامات SUV مبيعاً كذلك في 2023 بالسعودية, جرى الاعلان عن أكثر 10 سيارات بيك أب مبيعاً في 2023 بالسعودية. \r\n\r\n \r\n\r\nترتيب مبيعات البيك أب في السعودية\r\nوجاء ترتيب هذه السيارات كالتالي في السوق السعودي خلال مبيعات عام 2023 :\r\n\r\n1- تويوتا هايلوكس 30.976 ألف مركبة.\r\n\r\n2- إيسوزو دي ماكس بمبيعات 26.309 ألف مركبة.\r\n\r\n3- ميتسوبيشي L200 بعدد 8120 مركبة.\r\n\r\n4- شانجان هانتر 2499 مركبة.\r\n\r\n5- جي ام سي سييرا 2181 مركبة.\r\n\r\n6- جريت وول وينجل 1979 مركبة.\r\n\r\n7- فورد رينجر 1926 مركبة.\r\n\r\n8- شفروليه سلفرادو 1488 مركبة.\r\n\r\n9- جريت وول باور بمبيعات 1462 مركبة.\r\n\r\n10- فورد F-150 بمبيعات 1237 مركبة. \r\n\r\n \r\n\r\nأسعار تويوتا هايلوكس في السعودية\r\nوحسب موقع شركة عبداللطيف جميل وكيل تويوتا في السعودية تأتي أسعار طرازات تويوتا هايلوكس :\r\n\r\nSGLX دفع رباعي محرك 2700 سي سي بسعر 142.715 ألف ريال.\r\n\r\nSGLX دفع رباعي بمحرك 2400 سي سي بسعر 157.320 ألف ريال.\r\n\r\nSGLX دفع رباعي محرك 2400 سي سي بسعر 162.840 ألف ريال.', 'Announcing the Saudi pickup arrangement\r\nAfter announcing the best-selling sedans in Saudi Arabia in 2023, and the best-selling SUVs in 2023 in Saudi Arabia, the 10 best-selling pickups in 2023 in Saudi Arabia were announced.\r\n\r\n \r\n\r\nPickup sales ranking in Saudi Arabia\r\nThe ranking of these cars in the Saudi market during 2023 sales was as follows:\r\n\r\n1- Toyota Hilux, 30,976 thousand vehicles.\r\n\r\n2- Isuzu D-Max, with sales of 26,309 thousand vehicles.\r\n\r\n3- Mitsubishi L200, with 8,120 vehicles.\r\n\r\n4- Changan Hunter 2499 vehicles.\r\n\r\n5- GMC Sierra 2181 vehicles.\r\n\r\n6- Great Wall Wingle 1979 vehicle.\r\n\r\n7- Ford Ranger 1926 vehicle.\r\n\r\n8- Chevrolet Silverado 1488 vehicles.\r\n\r\n9- Great Wall Power, with sales of 1,462 vehicles.\r\n\r\n10- Ford F-150, with sales of 1,237 vehicles.\r\n\r\n \r\n\r\nToyota Hilux prices in Saudi Arabia\r\nAccording to the website of Abdul Latif Jameel Company, Toyota\'s agent in Saudi Arabia, the prices of Toyota Hilux models are:\r\n\r\nSGLX four-wheel drive, 2700 cc engine, priced at 142,715 thousand riyals.\r\n\r\nSGLX four-wheel drive with a 2400 cc engine, priced at 157,320 thousand riyals.\r\n\r\nSGLX four-wheel drive, 2400 cc engine, priced at 162,840 thousand riyals.', '2024-03-10 22:13:06', '2024-03-10 22:13:06'),
(5, 'الشكل الجديد لكيا بيكانتو 2024 مع فئات سبورت وGT-Line', 'الشكل الجديد لكيا بيكانتو 2024 مع فئات سبورت وGT-Line', 1, NULL, 'webstdy_1710109142listing_main_كيا_بيكانتو_2024__01.jpg', 'تم تجهيز كيا بيكانتو 2024 بشكل قياسي بمحرك رباعي الأسطوانات سعة 1200 سي سي بقوة متواضعة وتصميم مختلف تماماً عن السابق.\r\n\r\nاطلاق كيا بيكانتو في استراليا\r\nتم إطلاق نسخة جديدة من سيارة كيا بيكانتو من الجيل الثالث في أستراليا حيث سيتم تقديمها في شكلين وتظل خيارًا مقنعًا للغاية لمن يرغب في سيارة صغيرة ولكنها لا تزال مجهزة جيدًا.\r\n\r\n \r\n\r\nتحديث سيارة كيا بيكانتو بتصميم جديد\r\nوقد بذلت كيا جهودًا كبيرة لتحديث سيارة بيكانتو، لدرجة أنه يمكن اعتبارها طرازًا جديدًا تمامًا. وتظهر فلسفة التصميم الخاصة بالشركة \"الأضداد المتحدة\" على الفور من خلال الواجهة الأمامية التي تم تحديثها والتي تتضمن شبكة جديدة، ومصابيح أمامية مخصصة متوفرة مع مصابيح LED، ومصابيح خلفية مطورة بالكامل مع مصابيح جديدة وصادم مختلف. ويتم إطلاق كيا بيكانتو 2024 في أستراليا مع فئات Sport و GT-line.', 'The 2024 Kia Picanto is equipped as standard with a 1,200 cc four-cylinder engine with modest power and a completely different design than before.\r\n\r\nKia Picanto launched in Australia\r\nA new version of the third-generation Kia Picanto has been launched in Australia where it will be offered in two forms and remains a very compelling option for those who want a small but still well-equipped car.\r\n\r\n \r\n\r\nKia Picanto updated with a new design\r\nKia has put a lot of effort into updating the Picanto, to the point that it can be considered an entirely new model. The company\'s \"United Opposites\" design philosophy is immediately evident with the updated front end that includes a new grille, available custom headlights with LEDs, completely upgraded taillights with new lamps and a different bumper. The 2024 Kia Picanto is being launched in Australia with Sport and GT-line trims.', '2024-03-10 22:17:30', '2024-03-10 22:19:02'),
(6, 'هيونداي توسان 2025 الفيس ليفت', 'هيونداي توسان 2025 الفيس ليفت', 1, NULL, 'webstdy_17101092712025-Hyundai-Tucson-1.webp', 'هيونداي توسان 2025 فيس ليفت تتمتع بتحديثات مختلفة تتضمن بعض التعديلات الجمالية على الشكل الخارجي وتحديثات داخلية مميزة.\r\n\r\nتغييرات في شبكة هيونداي توسان 2025\r\nالجيل الرابع الحالي من هيونداي توسان موجود منذ عام 2020. والآن يبدو أن السيارة الـSUVالمدمجة قد حصلت أخيرًا على فيس ليفت كموديل 2025. وعلى الرغم من أنها قد تبدو بدون تغيير تقريباً في الخارج، إلا أن هناك بعض التغييرات على الشبكة الأمامية وألواح الانزلاق التي تجعل توسان تبدو أعرض.\r\nتغييرات داخلية في هيونداي توسان 2025\r\nويبدو التصميم الداخلي وكأنه ينتمي إلى طراز الجيل التالي حيث تم إعادة تشكيل لوحة القيادة بالكامل. ومثل أيونيك 5، تجمع توسان شاشتين مقاس 12.3 بوصة داخل نفس الإطار وتم استبدال شعار هيونداي الموجود على عجلة القيادة بأربع نقاط، وهو رمز مورس لحرف \"H\".\r\n\r\nاضافة مزيد من الأزرار المادية لسيارة هيونداي توسان 2025\r\nوتم أيضًا تجديد مجموعة المفاتيح الكهربائية المستخدمة لضبط إعدادات المناخ، ولحسن الحظ، أصبحت هناك أدوات تحكم تقليدية أكثر من ذي قبل. وبصرف النظر عن الأزرار القديمة، نلاحظ وجود زوج من المقابض الدوارة مع شاشات مدمجة لمكيف الهواء، بالإضافة إلى مقبضين فضيين آخرين للتحكم في مستوى الصوت والإعدادات الأخرى. كما أصبحت فتحات الهواء المركزية أقل حجماً من ذي قبل أيضًا وتعطي الوهم بوجود فتحة تهوية متصلة على مستوى لوحة القيادة.', 'Hyundai Tucson 2025 facelift enjoys various updates, including some aesthetic modifications to the exterior appearance and distinctive interior updates.\r\n\r\nChanges in the 2025 Hyundai Tucson network\r\nThe current fourth-generation Hyundai Tucson has been around since 2020. Now it looks like the compact SUV has finally gotten a facelift as a 2025 model. And while it may look almost unchanged on the outside, there are some changes to the front grille and skid plates that make the Tucson It looks wider.\r\nInternal changes in Hyundai Tucson 2025\r\nThe interior design looks like it belongs to the next generation model as the dashboard has been completely reshaped. Like the IONIQ 5, the Tucson packs two 12.3-inch displays inside the same frame and the Hyundai logo on the steering wheel has been replaced with four dots, which is the Morse code for the letter \"H.\"\r\nAdding more physical buttons to the Hyundai Tucson 2025\r\nThe switchgear used to adjust the climate settings has also been revamped, and thankfully there are more traditional controls than before. Aside from the old buttons, we notice a pair of rotary knobs with built-in displays for the air conditioning, as well as two other silver knobs for controlling the volume and other settings. The central air vents are also slimmer than before and give the illusion of a continuous air vent at the dashboard level.', '2024-03-10 22:21:11', '2024-03-10 22:22:18'),
(7, 'استبدال البنزين والديزل في السعودية بأنواع جديدة', 'استبدال البنزين والديزل في السعودية بأنواع جديدة', 0, NULL, 'webstdy_1710109500143-140041-led-hong-kong-list-most-expensive-sell-gasoline_700x400.jpg', 'الوقود البنزين والديزل المتاح في المملكة العربية السعودية من أصناف 91 و95 يتم استبدالهما مع الديزل بأنواع جديدة نظيفة رقم 5. \r\n\r\nأنواع وقود جديدة في السعودية\r\nكشفت وزارة الطاقة في المملكة العربية السعودية عن طرح وقودي الديزل والبنزين النظيفين رقم (5) في أسواق المملكة العربية السعودية، ليحلا محل وقودي الديزل والبنزين اللذين كانا في الأسواق.\r\n\r\n \r\n\r\nأنواع الوقود الجديدة في السعودية عالية الكفاءة وقليلة الانبعاثات\r\nوالوقودان الجديدان هما كسابقيهما، مناسبان لجميع وسائل النقل، والتغيير يستهدف توفير وقودٍ عالي الكفاءة، وقليل الانبعاثات، يُسهم في الحفاظ على البيئة وتحقيق مستهدفات رؤية المملكة 2030.\r\n\r\n \r\n\r\nأنواع الوقود الجديدة في السعودية تستهدف الوصول للحياة الصفري في 2060\r\n وأوضحت وزارة الطاقة أن طرح هذين المنتجين يأتيان ضمن جهود المملكة الرامية إلى خفض الانبعاثات، واستهداف الوصول إلى الحياد الصفري في عام 2060م، من خلال تطبيق نهج الاقتصاد الدائري للكربون، في إطارٍ يتوافق مع الخطط التنموية للمملكة، وينطلق من دورها الريادي في دعم الجهود الدولية المتعلقة بالبيئة والمحافظة عليها، ومواجهة آثار التغيُّر المناخي، مع المحافظة على مكانة المملكة بوصفها مورداً موثوقاً به لإمدادات الطاقة عالمياً.\r\n\r\n \r\n\r\nأنواع الوقود الجديدة في السعودية تتوافق مع مبادرة السعودية الخضراء\r\nكما بيّنت الوزارة أن المنتجين الجديدين يتوافقان مع مستهدفات مبادرة \"السعودية الخضراء\" وبرنامج كفاءة الطاقة، الذي أطلق معيار \"اقتصاد الوقود السعودي\"، بهدف تحسين كفاءة استهلاك الطاقة، وتحفيز الشركات المصنعة للسيارات لإدخال أحدث تقنيات كفاءة الطاقة في السيارات المستوردة إلى المملكة.', 'The gasoline and diesel fuels available in the Kingdom of Saudi Arabia, types 91 and 95, are being replaced with diesel by new, clean types No. 5.\r\n\r\nNew types of fuel in Saudi Arabia\r\nThe Ministry of Energy in the Kingdom of Saudi Arabia revealed the launch of clean diesel and gasoline fuel No. (5) in the markets of the Kingdom of Saudi Arabia, to replace the diesel and gasoline fuels that were on the market.\r\n\r\n \r\n\r\nNew fuel types in Saudi Arabia are highly efficient and low in emissions\r\nThe two new fuels, like their predecessors, are suitable for all means of transportation, and the change aims to provide highly efficient, low-emission fuel that contributes to preserving the environment and achieving the goals of the Kingdom’s Vision 2030.\r\n\r\n \r\n\r\nNew types of fuel in Saudi Arabia aim to reach zero life in 2060\r\n  The Ministry of Energy explained that the launch of these two products comes within the Kingdom’s efforts to reduce emissions and aim to reach zero neutrality in the year 2060 AD, by implementing the circular carbon economy approach, within a framework consistent with the Kingdom’s development plans, and stemming from its pioneering role in supporting international efforts related to Protecting and preserving the environment, and confronting the effects of climate change, while maintaining the Kingdom’s position as a reliable supplier of global energy supplies.\r\n\r\n \r\n\r\nNew fuel types in Saudi Arabia are compatible with the Saudi Green Initiative\r\nThe Ministry also stated that the two new products are consistent with the goals of the “Green Saudi Arabia” initiative and the energy efficiency program, which launched the “Saudi Fuel Economy” standard, with the aim of improving the efficiency of energy consumption and motivating car manufacturers to introduce the latest energy efficiency technologies in cars imported into the Kingdom.', '2024-03-10 22:25:00', '2024-06-08 11:12:52'),
(14, 'سيارة بيجو 408 2024 المواصفات والاسعار والمميزات والعيوب', 'Peugeot 408 2024 specifications, prices, advantages and disadvantages', 1, NULL, 'webstdy_17131623452022_6_22_12_20_33_179.webp', 'سيارة بيجو 408 من أحدث سيارات العلامة الفرنسية في السعودية، وقد اختلفت الآراء حول تصنيفها، فقيل أنها سيدان فاستباك وقيل إنها كروس أوفر كوبيه، وهذا الاختلاف أصله من الشركة نفسها التي تقول إنها صممت السيارة لتكون بين فئات مختلفة للتصميم.\r\n\r\nسيارة بيجو 408 تتميز بالشكل العصري المميز والتكنولوجيا الحديثة ما يجعلها محور اهتمام فئة الشباب، كما أنها مناسبة لرجال الأعمال، والعائلة الصغيرة من 5 أفراد.\r\n\r\nتتتوفر سيارة بيجو 408 في السعودية من خلال الوكيل الحصري للعلامة الفرنسية شركة المجدوعي للسيارات، وفي هذا المقال نتحدث بالتفصيل عن التصميم والمواصفات المتوفرة بها في السعودية.\r\nتحافظ سيارة بيجو 408 على ملامح التصميم المعروفة عن سيارات العلامة الفرنسية، حيث أن المصابيح الأمامية تأتي حادة مع الإضاءة النهارية على شكل ناب الأسد، وتأتي الإضاءة متصلة بالشبك الأسود المميز بالتصميم الطولي.\r\n\r\nوتتميز السيارة بالتصميم الديناميكي الذي يظهر في خطوط انسيابية للجسم من المقدمة إلى الخلفية، والسقف المنحدر بشدة، ما يساهم في منح السيارة معامل سحب منخفض للغاية، 0.28، ما يجعلها سيارة ذات شخصية رياضية في الأداء.\r\n\r\nعيوب سيارة بيجو 408\r\nأبرز الانتقادات التي قيلت عن سيارة بيجو 408\r\n\r\nمساحة الركوب من باب السائق ضيقة نتيجة للسقف المنخفض وعتبة الباب المرتفعة\r\nتسارع السيارة من 0 – 100 كم/ س ليس مبهرا، حيث قد يستغرق نحو 8 ثواني\r\nكفاءة استهلاك الوقود ليست من الأفضل في فئتها حيث تبلغ 15.7 كم/ لتر\r\nلا تتوفر السيارة بنظام دفع كلي الذي كان من الممكن أن يضيف إلى متعة القيادة مع إكسابها بعض القدرات على الطرق الوعرة', 'The Peugeot 408 is one of the latest cars of the French brand in Saudi Arabia. Opinions differed about its classification. It was said that it is a fastback sedan and it was said that it is a crossover coupe. This difference originates from the company itself, which says that it designed the car to be between different design categories.\r\n\r\nThe Peugeot 408 is distinguished by its distinctive modern appearance and modern technology, which makes it the focus of attention of young people. It is also suitable for businessmen and a small family of 5 members.\r\n\r\nThe Peugeot 408 is available in Saudi Arabia through the exclusive agent of the French brand, Almajdouie Motors Company. In this article, we talk in detail about the design and specifications available with it in Saudi Arabia.\r\nThe Peugeot 408 maintains the design features known from the French brand\'s cars, as the headlights are sharp with daytime running lights in the shape of a lion\'s tusk, and the lighting is connected to the black grille, which is distinguished by its longitudinal design.\r\n\r\nThe car is distinguished by its dynamic design, which appears in the flowing lines of the body from front to rear, and the steeply sloping roof, which contributes to giving the car a very low drag coefficient of 0.28, making it a car with a sporty performance character.\r\n\r\nDisadvantages of Peugeot 408\r\nThe most prominent criticisms made about the Peugeot 408\r\n\r\nPassenger space through the driver\'s door is tight due to the low roof and high door sill\r\nThe car\'s acceleration from 0-100 km/h is not impressive, as it may take about 8 seconds\r\nFuel efficiency is not one of the best in its class at 15.7 km/l\r\nThe car is not available with an all-wheel drive system, which could have added to the driving pleasure while giving it some off-road capabilities', '2024-04-11 04:40:51', '2024-04-15 09:25:45'),
(15, 'أكثر 10 سيارات مبيعاً في السعودية خلال الربع الأول من العام', 'The 10 best-selling cars in Saudi Arabia during the first quarter of the year', 1, NULL, 'webstdy_1716023293renault-800.jpg', 'تصدر تويوتا لقائمة السيارات السعودية الأكثر مبيعاً\r\nكشفت تقارير مختلفة عن السيارات التي نجحت في تصدر المبيعات في سوق السيارات السعودي في الفترة من يناير الي مارس 2024 والتي تعرف بالربع الأول من العام. والغريب في القائمة أن سيارات تويوتا كورولا جاءت متأخرة بمراحل عن سيارات أخرى من علامات تويوتا جاءت متصدرة للقائمة. \r\nترتيب السيارات الأكثر مبيعاً في السعودية\r\nوجاء ترتيب السيارات في القائمة كالتالي :\r\n\r\n1- تويوتا يارس بعدد 10,343 سيارة.\r\n\r\n2- تويوتا كامري بعدد 10,101 سيارة.\r\n\r\n3- هيونداي أكسنت بعدد 8,275 سيارة.\r\n\r\n4- كيا بيجاس بعدد 6,402 سيارة.\r\n\r\n5- سوزوكي سويفت ديزاير بعدد 5,860 سيارة.\r\n\r\n6- نيسان صني بعدد 5,524 سيارة.\r\n\r\n7- هيونداي إلنترا بعدد 4,517 سيارة.\r\n\r\n8- تويوتا كورولا  بعدد 4,392 سيارة.\r\n\r\n9- فورد توروس بعدد 3,714 سيارة\r\n\r\n10- هيونداي كريتا بعدد 3,488 سيارة.\r\nاتجاه في السعودية للسيارات السيدان الصغيرة الاقتصادية\r\nوسيارة مثل تويوتا ياريس تتصدر القائمة وربما يكون ذلك لأن سعرها أقل من باقي طرازات تويوتا في السعودية وهناك اتجاه للسيارات الأكثر اقتصادية سواء في تكلفة التشغيل أو السعر الأساسي لها وهو ما نراه في ظهور هيونداي أكسنت وكيا بيجاس وسوزوكي سويفت ديزاير ونيسان صني في القائمة.', 'Toyota tops the list of best-selling Saudi cars\r\nVarious reports revealed the cars that succeeded in topping sales in the Saudi car market in the period from January to March 2024, which is known as the first quarter of the year. What is strange about the list is that Toyota Corolla cars came some time later than other Toyota cars that topped the list.\r\nRanking of the best-selling cars in Saudi Arabia\r\nThe order of cars on the list is as follows:\r\n\r\n1- Toyota Yaris, with 10,343 cars.\r\n\r\n2- Toyota Camry with 10,101 cars.\r\n\r\n3- Hyundai Accent with 8,275 cars.\r\n\r\n4- Kia Pegas with 6,402 cars.\r\n\r\n5- Suzuki Swift Dzire with 5,860 cars.\r\n\r\n6- Nissan Sunny with 5,524 cars.\r\n\r\n7- Hyundai Elantra, with 4,517 cars.\r\n\r\n8- Toyota Corolla, with 4,392 cars.\r\n\r\n9- Ford Taurus with 3,714 cars\r\n\r\n10- Hyundai Creta with 3,488 cars.\r\nA trend in Saudi Arabia for small economical sedans\r\nA car like the Toyota Yaris tops the list, and this may be because its price is lower than other Toyota models in Saudi Arabia. There is a trend for more economical cars, whether in terms of operating cost or their basic price, which is what we see in the appearance of the Hyundai Accent, Kia Pegas, Suzuki Swift Dzire, and Nissan Sunny on the list.', '2024-05-18 12:08:13', '2024-05-18 12:08:13'),
(16, 'هيونداي ستار جيزر الجديدة للعائلة', 'New Hyundai Star Geezer for the family', 1, NULL, 'webstdy_1716734198stargazer-ksr-highlights-the-new-star-of-the-family-original.jpg', 'كشفت هيونداي الستار عن سيارة “ستار جيزر” الجديدة في إندونيسيا، وهي ميني فان بثلاثة صفوف مقاعد وسعر تنافسي ومساحة رحبة للعائلات.\r\n\r\nوتأتي السيارة بتصميم ديناميكي للزجاج الأمامي، وخلوص أرضي مرتفع ومصابيح LED أمامية ممتدة يعرض السيارة بأكملها، وهو تصميم مستوحى من هيونداي ستاريا ميني فان، وستتوفر السيارة بجنوط 15 أو 16 إنش، ومصابيح خلفية على شكل المثلث، وسقف أسود.\r\nوتدعم الداخلية 6 أو 7 مقاعد مقسمة على ثلاثة صفوف، مع مساحة تخزينية 200 لتر، وترتفع إلى 585 لتر عند طي الصف الثالث من المقاعد، وتشمل المواصفات: شاشة لمسية ترفيهية 8 إنش، ولوحة عدادات 4.2 إنش، وأحدث أنظمة هيونداي للسلامة مثل راصد النقطة العمياء والتفادي المبكر للتصادم.\r\nوستتوفر هيونداي ستار جيزر الجديدة بمحرك 1.5 لتر 4 سلندر بنزين بالتنفس الطبيعي بقوة 115 حصان وعزم 144 نيوتن متر، مقترن بناقل يدوي او سي في تي 6 سرعات، ونظام دفع أمامي.\r\n\r\nوتنوي هيونداي بناء ستار جيزر ميني فان الجديدة في إندونيسيا وستنطلق بأسعار تبدأ من 16 ألف دولار – 60 ألف ريال قبل الضرائب المختلفة.', 'Hyundai unveiled the new “Star Geezer” in Indonesia, which is a minivan with three rows of seats, a competitive price and ample space for families.\r\n\r\nThe car comes with a dynamic windshield design, high ground clearance, and extended LED headlights that display the entire car. It is a design inspired by the Hyundai Staria minivan. The car will be available with 15- or 16-inch wheels, triangle-shaped taillights, and a black roof.\r\nThe interior supports 6 or 7 seats divided into three rows, with a storage space of 200 liters, which increases to 585 liters when the third row of seats is folded. Specifications include: an 8-inch entertainment touch screen, a 4.2-inch instrument panel, and the latest Hyundai safety systems such as a blind spot monitor. And early collision avoidance.\r\nThe new Hyundai Star Geezer will be available with a 1.5-liter, 4-cylinder, naturally aspirated gasoline engine with a power of 115 horsepower and 144 Nm of torque, coupled to a 6-speed manual transmission or CVT, and a front-wheel drive system.\r\n\r\nHyundai intends to build the new Star Geezer minivan in Indonesia, and it will be launched at prices starting from 16 thousand dollars - 60 thousand riyals before various taxes.', '2024-05-26 17:36:39', '2024-05-26 17:36:39'),
(17, 'الكشف عن مازدا CX-60 كأقوى سيارة في تاريخ الشركة!', 'Mazda CX-60 revealed as the most powerful car in the company\'s history!', 1, NULL, 'webstdy_17178342932022-Mazda-CX-60-A13-1000x648.jpg', 'كشفت مازدا عن أحدث سياراتها على قاعدة عجلات جديدة وبمحركات هجينة لتصبح CX-60 واحدة من سيارات مازدا التي تشكل مستقبل الشركة.\r\n\r\nتستخدم السيارة قاعدة عجلات قياسية Multi-Solution Scalable Architecture، وتأتي بأبعاد 4,745 مليميتر طولاً و1,890 ميليمتر عرضاً و1,680 ميليمتر ارتفاعاً، ويبلغ طول قاعدة العجلات 2,870 ميليمتر. تمتاز مازدا CX-60 بواجهة أمامية منحوتة مع شبك أمامي عميق ومصابيح متصلة. وتحصل الواجهة الخلفية على مصابيح عريضة، وتقف السيارة على جنوط تتراوح بين 18 إنش و20 إنش.\r\n\r\nفي الداخل، نجد تصميم راقي ومواد فاخرة مع تقنيات عصرية مثل لوحة العدادات الرقمية وشاشة المعلومات والنظام الترفيهي قياس 12.3 بوصة،  بحصل السائقون على مجموعة أدوات قيادة ذات تصميم رياضي عصري مثبتة بالكونسول الوسطي، ويتوفر وضعيات قيادة متعددة. تتميز السيارة بخاصية الضبط التلقائي للمرايا بحسب وضعية السائق وتحديداً موضع العيون.\r\n\r\nستتوفر مازدا CX-60 بـ3 خيارات من المحركات تشمل محرك 2.5 لتر مع محرك كهربائي تنتج مجموع 323 حصان تجعل CX-60 أقوى سيارة إنتاجية في تاريخ الشركة، وتحقق هذه الفئة تسارع 0-100 كم/س في 5.8 ثانية فقط وتصل سرعتها القصوى لـ200 كم/س. توفر السيارة مدى كهربائي يبلغ 60 كيلومتر وتحقق كفاءة وقود تبلغ  1.5 لتر/100 كيلومتر.\r\n\r\nفي السوق الأوروبي ستتوفر العديد من ميزات السلامة بشكل قياسي لـ CX-60 تشمل رؤية محيطية 360 درجة، نظام التحذير من الخروج من المسار، التعرف على إشارات المرور، مساعدة الفرامل الذكية، نظام اكتشاف المشاة وراكبي الدراجات، اكتشاف التقاطعات، نظام الحفاظ على المسار، وتتوفر ميزات اختيارية مثل ومراقبة النقطة العمياء، وتنبيه حركة المرور الخلفية، ونظام التحكم في السرعة i-Adaptive Cruise، ومساعد القيادة على المنحدرات.', 'Mazda revealed its latest cars on a new wheelbase and with hybrid engines, making the CX-60 one of the Mazda cars that shape the company\'s future.\r\n\r\nThe car uses a standard wheelbase, Multi-Solution Scalable Architecture, and has dimensions of 4,745 mm in length, 1,890 mm in width and 1,680 mm in height, and the length of the wheelbase is 2,870 mm. The Mazda CX-60 has a sculpted front end with a deep grille and attached lights. The rear fascia gets wide lights, and the car stands on wheels ranging from 18 inches to 20 inches.\r\n\r\nInside, we find a sophisticated design and luxurious materials with modern technologies such as a digital instrument panel, a 12.3-inch information screen, and an entertainment system. Drivers get a driving instrument cluster with a modern, sporty design installed on the center console, and multiple driving modes are available. The car features automatic adjustment of the mirrors according to the driver\'s position, specifically the position of the eyes.\r\n\r\nThe Mazda CX-60 will be available with 3 engine options, including a 2.5-liter engine with an electric motor that produces a total of 323 horsepower, making the CX-60 the most powerful production car in the company’s history. This category achieves acceleration from 0-100 km/h in just 5.8 seconds and reaches a top speed of 200 km/h. /s. The car offers an electric range of 60 km and achieves a fuel efficiency of 1.5 l/100 km.\r\n\r\nIn the European market, many safety features will be available as standard for the CX-60, including 360-degree surround view, lane departure warning system, traffic sign recognition, smart brake assist, pedestrian and cyclist detection system, intersection detection, lane keeping system, Optional features are available such as blind spot monitoring, rear cross-traffic alert, i-Adaptive Cruise control, and hill start assist.', '2024-06-08 11:11:33', '2024-06-08 11:11:33'),
(18, 'سيارة كيا K4 2025 الجديدة', 'The new Kia K4 2025', 1, NULL, 'webstdy_1719043959سيارة-كيا-K4-2025-1-1.jpg', 'مؤخرًا، كشفت كيا الستار عن سيارة K4 الجديدة كلياً والتي ستحل محل سيارتها السيدان كيا سيراتو (أو فورتي كما هي معروفة في السوق الأمريكي)، بتحديثات شاملة للتصميم الخارجي وداخلية أكثر فخامة وجاذبية، وإليكم أبرز مواصفات كيا K4 2025\r\nبالحديث عن التصميم الخارجي للسيارة السيدان الرياضية ذات التصميم الخارجي الفريد، نجد أنها تحظى بلغة تصميم جديدة أكثر جراءة وتعقيداً من سيراتو الحالية التي طرحتها كيا في عام 2018، مع لمسات مستوحاة من سيارة “ستينجر” التي توقف إنتاجها، وسيارة EV9 الكهربائية الجديدة كليًا، فضلًا عن تصميم الرفارف الخلفية، ومقابض الأبواب الخلفية المخفية، إلى عواميد D القوية المستوحاة من “ستينجر” تمنح السيارة طابعاً أقرب للتصميم الكوبيه، بالإضافة إلى مصابيح أمامية وخلفية تعمل بتقنية الـ LED جديدة.\r\nبالانتقال إلى داخلية كيا k4 2024، نجد أنها قد حصلت على مقصورة فخمة بلمسات حديثة وتقنيات متطورة، بداية من عجلة قيادة مربعة متعددة الوظائف، مع مساحات داخلية رحبة ولمسات جمالية مستوحاة من سيارات EV6 و EV9 الكهربائية وأيضًا كيا سورينتو فيس ليفت الجديدة، كما تعتمد كيا K4 على ذراع تقليدية لنقل السرعات على الكونسول الأوسط، وتشمل مواصفات الداخلية لوح زجاجي موحد جديد، يجمع بين شاشة المعلومات الترفيهية ولوحة العدادات الرقمية.\r\nعلى الأرجح ستنطلق كيا K4 2025، بمحرك بنزين تيربو 4 اسطوانات بسعة 1.6 لتر، ينتج قوة قدرها 190 حصان، مع عزم أقصى للدوران يبلغ 264 نيوتن متر، مع ناقل حركة أوتوماتيكي مكون من 8 سرعات.', 'Recently, Kia unveiled the all-new K4, which will replace its Kia Cerato sedan (or Forte as it is known in the American market), with comprehensive updates to the exterior design and a more luxurious and attractive interior. Here are the most prominent specifications of the Kia K4 2025.\r\nSpeaking of the exterior design of the sports sedan with its unique exterior design, we find that it has a new design language that is bolder and more complex than the current Cerato that Kia introduced in 2018, with touches inspired by the “Stinger” car, whose production was discontinued, and the all-new EV9 electric car, as well as From the design of the rear fenders, the hidden rear door handles, to the strong D-pillars inspired by the “Stinger”, giving the car a character closer to the coupe design, in addition to new front and rear lights that use LED technology.\r\nMoving on to the interior of the Kia K4 2024, we find that it has received a luxurious cabin with modern touches and advanced technologies, starting with a multi-function square steering wheel, with spacious interior spaces and aesthetic touches inspired by the EV6 and EV9 electric cars as well as the new Kia Sorento facelift, as Kia relies on... K4 has a traditional gearshift lever on the center console, and interior specifications include a new unified glass panel, combining the entertainment information screen and the digital instrument panel.\r\nThe 2025 Kia K4 will most likely be launched with a 1.6-liter 4-cylinder turbo gasoline engine, producing 190 horsepower, with a maximum torque of 264 Newton metres, with an 8-speed automatic transmission.', '2024-06-22 11:12:39', '2024-06-22 11:12:39'),
(19, 'هيونداي باليسيد تحت التحقيق في أمريكا بسبب هذا الخلل!', 'Hyundai Palisade under investigation in America due to this defect!', 1, NULL, 'webstdy_17236433232023-hyundai-palisade-beauty-shot-750x375.jpg.webp', 'فتحت الإدارة الوطنية للسلامة المرورية على الطرق السريعة (NHTSA) تحقيقًا في بعض سيارات هيونداي باليسيد المباعة في الولايات المتحدة بسبب مشكلة تتعلق بميزة السلامة الأساسية: أحزمة الأمان، ووفقًا لمكتب التحقيق في العيوب التابع للوكالة (ODI)، قد تميل أحزمة الأمان في سيارات الدفع الرباعي إلى الفك دون سابق إنذار، مما يجعلها عديمة الفائدة في حالة وقوع حادث.\r\n(( تفاصيل المشكلة الخطيرة في سيارات هيونداي باليسيد في أمريكا ))\r\nوفقًا لوثيقة NHTSA، تم فتح التحقيق هذا الأسبوع، وتحديدًا في 7 أغسطس 2024، وقدرت ODI أن 332,288 سيارة من هيونداي باليسيد، ضمن موديلات 2020-2023، تأثرت بالعيب المزعوم، وتجدر الإشارة إلى أن سيارات باليسيد المباعة في أمريكا تم إنتاجها في موطن هيونداي الأصلي في كوريا الجنوبية على الرغم من أن الوثيقة تنص على خلاف ذلك، وبحسب ما ورد فكرت شركة هيونداي في تصنيع سيارة الدفع الرباعي في الولايات المتحدة، لكن ذلك لم ينجح.\r\n\r\nولم تحدد وثيقة NHTSA أيًا من أحزمة الأمان في السيارة ذات الدفع الرباعي ذات الصفوف الثلاثة قد تم فكها، لكن ODI تلقت 37 شكوى حول نفس المشكلة، وأضافت أن أحزمة الأمان انفصلت عن غير قصد، مما زاد من المخاطر لأن ركاب المقعد لم يكونوا على علم بأنهم لن يعملوا في حالة وقوع حادث.\r\nهيونداي باليسيد ليست غريبة على المشاكل، وكانت القضايا الأحدث جزءًا من دعوى قضائية رفيعة المستوى تم رفعها العام الماضي ضد شركة هيونداي، مع مشكلات تتعلق بمخاطر الحريق وأربعة “حوادث حرارية” مسجلة، وأصدرت شركة صناعة السيارات استدعاءً لإصلاح المشكلة.\r\n\r\nوفي الختام، مع تقديم أول سيارة باليسيد في عام 2018، دخلت هيونداي بالفعل في مرحلة تطوير طراز الجيل التالي، والذي يوصف بأنه “المستوى التالي”، وبحسب ما ورد تقوم شركة صناعة السيارات بتسريع الجدول الزمني للإنتاج لمواكبة الطلب المرتفع، ونأمل أن تتمتع باليسيد الجديدة بتصميم أفضل للمقعد لمنع فك أحزمة الأمان عن غير قصد عند وصولها إلى الولايات المتحدة بحلول النصف الثاني من عام 2025.', 'The National Highway Traffic Safety Administration (NHTSA) has opened an investigation into some Hyundai Palisade vehicles sold in the United States due to a problem with a key safety feature: seat belts. According to the agency’s Office of Defects Investigation (ODI), the SUV’s seat belts may tend to unfasten without warning, rendering them useless in the event of a crash.\r\n(( Details of the Serious Problem with Hyundai Palisade Vehicles in America ))\r\nAccording to the NHTSA document, the investigation was opened this week, specifically on August 7, 2024, and the ODI estimates that 332,288 Hyundai Palisade vehicles, within the 2020-2023 model years, are affected by the alleged defect. It is worth noting that Palisade vehicles sold in America were produced in Hyundai’s home country of South Korea, despite the document stating otherwise. Hyundai reportedly considered manufacturing the SUV in the United States, but that did not work out.\r\n\r\nThe NHTSA document didn’t specify which of the three-row SUV’s seat belts had unlatched, but ODI received 37 complaints about the same issue, adding that the seat belts had unintentionally detached, increasing the risk because seat occupants were unaware that they wouldn’t work in the event of a crash.\r\n\r\nThe Hyundai Palisade is no stranger to problems, and the most recent cases were part of a high-profile lawsuit filed last year against Hyundai, with fire hazard issues and four “heat incidents” reported, and the automaker issued a recall to fix the problem.\r\n\r\nFinally, with the first Palisade introduced in 2018, Hyundai is already in development of the next-generation model, which it describes as “the next level.” The automaker is reportedly accelerating its production schedule to keep up with high demand, and hopefully the new Palisade will have a better seat design to prevent unintentional seat belt unlatching when it arrives in the US in the second half of 2025.', '2024-08-14 16:48:43', '2024-08-14 16:48:43');
