(17, 'meta_tag_description_ar', '\"مرحبًا بكم في موقع كود كار للسيارات الموقع الرائد الذي يساعدك في العثور على اسعار السيارات وأقساطها عن طريق جميع شركات التمويل والبنوك السعودية بسرعة ودقة. سواء كنت تبحث عن اسعار السيارات او حاسبة تمويلية تناسب وضعك الأئتماني', '2024-03-10 00:54:20', '2024-07-13 17:34:15'),
