(25, 'privacy_policy_ar', '<ul style=\"list-style-type: square;\">\r\n<li style=\"text-align: center;\"><strong><br /><span style=\"background-repeat: no-repeat; box-sizing: border-box; margin: 0px; padding: 0px; color: #5a7184; font-family: Janna-lt, sans-serif; text-align: start; background-color: #ffffff;\">      تم تحديث الشروط والأحكام بتاريخ / 2024/03/13 م        </span><br /></strong></li>\r\n<li style=\"text-align: center;\"><strong><code>تعهد الخصوصية</code></strong></li>\r\n<li style=\"text-align: center;\"><strong>نحن في \" موقع كود كار \" حريصون اشد الحرص على حماية بيناتك الشخصية الخاصة بك من أي سوء استخدام أو تسريبها </strong></li>\r\n<li style=\"text-align: center;\"><strong> ولن يتم بيعها إلى أي جهة بمقابل أو بدون مقابل.</strong></li>\r\n<li style=\"text-align: center;\"><strong><code>المعلومات الشخصية التي نجمعها</code></strong></li>\r\n<li style=\"text-align: center;\"><strong>عند قيامك بالتسجيل والدخول إلى \" موقع كود كار \" فأنك توافق وتسمح لنا بجمع بعض المعلومات عنك </strong></li>\r\n<li style=\"text-align: center;\"><strong>لنقدم لك أفضل خدماتنا وأفضل تجربة وفقاً لسياسة الخصوصية. ولكي تكون على دراية كاملة بالمعلومات</strong></li>\r\n<li style=\"text-align: center;\"><strong> التي نجمعها سنعرض عليك ماهي البينات التي نجمعها.</strong></li>\r\n<li style=\"text-align: center;\"><strong>- اسمك، العنوان، البريد الإلكتروني، رقم الهاتف، وغيرها من المعلومات الأساسية.</strong></li>\r\n<li style=\"text-align: center;\"><strong>- معلومات مالية محدودة مثل. الراتب. جهة العمل. المدينة. او الالتزامات المالية في بعض المعاملات التمويلية.</strong></li>\r\n<li style=\"text-align: center;\"><strong>معلومات من أطراف ثالثة تقوم بالموافقة عليها والموافقة على تزويدنا بها.</strong></li>\r\n<li style=\"text-align: center;\"><strong> الإعلانات المضافة من المستخدم بجميع معلوماتها المدخلة وصورها<span style=\"text-align: right;\">.</span></strong></li>\r\n<li style=\"text-align: center;\"><strong> الكوكيز (ملفات تعريف الارتباط) وهي عبارة عن ملفات نصية صغيرة يتم تخزينها على جهاز الكمبيوتر</strong></li>\r\n<li style=\"text-align: center;\"><strong> الخاص بالعميل لأغراض حفظ السجلات من خلال المتصفح الخاص بك لتقديم أفضل الخدمات لكم</strong></li>\r\n<li style=\"text-align: center;\"><strong>- بخلاف ما ذكر سابقاً فأنه لن يتم مشاركة بينات العميل الائتمانية والشخصية لطرف ثالث الا بعد</strong></li>\r\n<li style=\"text-align: center;\"><strong>    أخطار العميل بذلك وموافقته عليها وماهي البينات التي تم مشاركتها ولآي جهة تم ذلك .</strong></li>\r\n<li style=\"text-align: center;\"><strong> معلومات عن طريق الاتصال – أن تبين لنا أن المعلومات وبينات المستخدم أو العميل غير صحيحة</strong></li>\r\n<li style=\"text-align: center;\"><strong>  أو غير واضحة أو ناقصة فسيتم الاتصال بك لتصحيح هذه البينات عن طريق فريق خدمة</strong></li>\r\n<li style=\"text-align: center;\"><strong>العملاء الخاص بنا أو احد الأطراف أو الشركات نيابة عنا</strong></li>\r\n<li style=\"text-align: center;\"><code><strong>                  www.codecar.com.sa                  </strong></code></li>\r\n</ul>', '2024-03-10 00:54:20', '2024-07-13 17:34:15'),
(26, 'privacy_policy_en', '<h3 style=\"text-align: center;\">( privacy policy )</h3>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\"><code><span style=\"text-decoration: underline;\">Privacy Pledge</span></code></p>\r\n<p style=\"text-align: center;\">We at the “Code Car Website” are very keen to protect your personal data from any misuse or leaking.</p>\r\n<p style=\"text-align: center;\">  It will not be sold to any party for or without compensation.</p>\r\n<p style=\"text-align: center;\">Personal information we collect</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">When you register and log into the “Code Car website”, you agree and allow us to collect some information about you</p>\r\n<p style=\"text-align: center;\">To provide you with our best services and the best experience in accordance with our privacy policy. In order to be fully aware of the information</p>\r\n<p style=\"text-align: center;\">  What we collect We will show you what data we collect.</p>\r\n<p style=\"text-align: center;\">- Your name, address, email, phone number, and other basic information.</p>\r\n<p style=\"text-align: center;\">- Limited financial information e.g. Salary. Employer. City. Or financial obligations in some financing transactions</p>\r\n<p style=\"text-align: center;\">- Ads added by the user with all their entered information and images</p>\r\n<p style=\"text-align: center;\">- Cookies are small text files that are stored on your computer</p>\r\n<p style=\"text-align: center;\">  Customer for record keeping purposes through your browser to provide better services to you</p>\r\n<p style=\"text-align: center;\">- Other than what was mentioned previously, the customer’s credit and personal information will not be shared with a third party until after</p>\r\n<p style=\"text-align: center;\">     Notifying the client of this and agreeing to it, and what data was shared and to whom it was shared.</p>\r\n<p style=\"text-align: center;\">  - Information by contacting - showing us that the information and data of the user or customer are incorrect</p>\r\n<p style=\"text-align: center;\">   If it is unclear or incomplete, you will be contacted to correct this information through the service team</p>\r\n<p style=\"text-align: center;\">Our clients or one of the parties or companies on our behalf.<br /><br /></p>\r\n<h6 style=\"text-align: center;\"><strong style=\"font-family: monospace; font-size: medium;\">www.codecar.com.sa  </strong></h6>', '2024-03-10 00:54:20', '2024-07-13 17:34:15'),
(27, 'terms_and_conditions_en', '<p style=\"text-align: center;\">The terms and conditions were updated on 03/13/2024 AD</p>\r\n<p style=\"text-align: center;\">We welcome you to the “Code Car Website”, a platform for selling and financing cars.</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">The best digital broker and advisor to serve you to obtain car financing services or offer them on our platform with ease</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">We offer you the best options that suit your financial and credit situation and in the fastest time, such as (selling, buying, applying for car financing).</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">  ( Terms and Conditions )</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">  Terms of use and registration</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">- You must read these terms carefully before registering an account or using any of the services and determine whether these terms and services are appropriate to your personal, financial and credit circumstances.</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">- Entering the website portal and registering on it using your name and mobile number means your full agreement to the terms, policy, and “Code Car Website”</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">You are fully responsible for the accuracy of the information you have entered and that it is not fictitious or false. “Code Car Website” has the right to restrict your access to your account and to delete all content related to the user account if you indicate to us otherwise. Or if you use your account and the site for the following purposes.</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">1- Using the website to commit a crime or encourage others to engage in any behavior that may be considered a crime or involve civil or commercial liability.</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">2- Using the site to impersonate other people or parties.</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">3- Using the site to upload any material that contains programs that contain viruses, “Trojan horses,” or any computer codes, files, or programs that may change, damage, or impede the work of the site or any device or program belonging to any person who accesses the site.</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">4- Claiming a connection with, or representing, any company, association, or body without being authorized to claim that relationship.</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">5-Change, destroy, or delete any content on the site.</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">6- Other advertisements that do not comply with the site’s policy, such as promoting goods other than new and used cars</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">7- Fictitious or false advertisements that are used for electronic fraud or to transfer money to fictitious people.</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">8-International advertisements for cars located outside the Kingdom of Saudi Arabia.</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">9- The member and user of the “Code Car website” is committed not to share his account information with other people.</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">10- The member or user of the “Code Car website” is committed to ensuring that the pictures added to the item are of the same item as the advertised item.</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">(Publish ads)</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">All advertisements added on the “Code Car website” are entirely the responsibility of the registered members and users of the website</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">The Code Car website does not bear any responsibility for added content that violates the site’s policy. And \"Code Car website\"</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">It plays a supervisory role as much as possible for the content on its website and ensures the publishers of the content and its truth and shows us that the conditions are violated. The account will be restricted and access will be unable to be accessed without prior notification of this.</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">For members or users of the content and advertising policy.</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">  (Delivering the service to customers)</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">Customers are notified of car financing applications (of acceptance or rejection of their application) via mobile number or via registered email, if any, and via their account on the site (notifications).</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">For each registered customer.</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">(cancellation policy)</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">“Code Car Website” is a digital intermediary for car financing services. His work is limited to obtaining the approval of the appropriate financing authorities for the client. Every customer who has submitted a leasing financing request to obtain a car has the right to withdraw or cancel his request before signing contracts or issuing license plates for the requested car with the financing application number.</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">Advertisements prohibited from being published.</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">- All advertisements that are not related to buying or selling cars</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">- All ads have incomplete details, prices and images</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">- An ad that does not contain good quality images or is related to cars</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">( Evacuation responsibilaty )</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">“Code Car website” is an intermediary between the customer and the financing parties only. He is not a party to any agreements signed between customers and financing entities, and he is not responsible at all for any consequences or disputes resulting from that agreement between the two parties, such as financial transfers or off-site purchases between the two parties.</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">  (Customer and financing party)</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">(Contact the site administration)</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">You can communicate with the management of: “Code Car website” at all times through the means of communication that have been provided to you.</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">* Via the unified number 920009183</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">info@codecar.com.sa official website email *</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">Or by phone: 0504650777 – 0502475777 *</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">(Website disclaimer notice)</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">- The “Code Car website” does not bear any responsibility or any accident or events that occur when you browse this site</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">- Any damage to the user’s devices during use or as a result of the inability to use the site</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">The level of accuracy of the contents of websites linked to the site in terms of completeness or modernity, or freedom from linguistic, typographical, or other errors, or interruption or cessation of information for any reason, whether technical, emergency, or intentional.</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">- Any suspicious messages, links, indicators, or advice received by members and users of the site.</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">(Usage safety warnings)</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">*Online websites are not free of advertisements aimed at defrauding you. Therefore, great care must be taken not to fall into these methods, and the following are some of them (but not limited to examples).</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">- Requesting a money transfer before seeing the product or part of it (a deposit).</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">- Attractive advertisements with irrational prices for a product that differs from its market value.</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">- Use advertising images for the product taken from the Internet.</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">The advertisement is worded in a fraudulent way to attract your attention at very attractive prices.</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">- Fraudsters evade seeing the product or meeting you and claiming that they are in a very distant city.</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">- Request identification documents from the advertiser that he is the owner of the product and inspect the product to ensure its safety.</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">(content rights)</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">All content on the “Code Car Website” including designs, advertisements, images and sound</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">  Logos and software are the exclusive property of the “Code Car website” and are protected under Saudi trade law</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">  No party has the right to copy, imitate or use any existing content, whatever it may be</p>\r\n<p style=\"text-align: center;\"> </p>\r\n<p style=\"text-align: center;\">Under penalty of legal accountability.<br /><br /></p>\r\n<h3 style=\"text-align: center;\"><strong style=\"font-family: monospace; font-size: medium;\">www.codecar.com.sa  </strong></h3>', '2024-03-10 00:54:20', '2024-07-13 17:34:15'),
(28, 'terms_and_conditions_ar', '<h6 style=\"text-align: center;\"><strong>تم تحديث الشروط والأحكام بتاريخ / 2024/03/13 م</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong>نرحب بكم في \" موقع كود كار \" منصة بيع وتمويل السيارات. </strong></h6>\r\n<h6 style=\"text-align: center;\"><strong>الوسيط والمستشار الرقمي الأفضل لخدمتك للحصول على خدمات تمويل السيارات أو عرضها على منصتنا بكل سهولة</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong>ونقدم لك أفضل الخيارات التي تناسب وضعك المالي والائتماني وبأسرع وقت مثل (بيع. شراء. طلب تمويل سيارة)</strong></h6>\r\n<h3 style=\"text-align: center;\"><strong><code>  ( الشروط والأحكام ) <br /></code></strong></h3>\r\n<h5 style=\"text-align: center;\"><strong>          شروط الاستخدام والتسجيل         </strong></h5>\r\n<h6 style=\"text-align: center;\"><strong>- يجب قراءة هذه الشروط بعناية قبل تسجيل الحساب أو استخدام أي من الخدمات وتحديد ما إذا كانت هذه الشروط والخدمات تتناسب مع ظروفك الشخصية والمادية والائتمانية .</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong>- أن الدخول لبوابة الموقع والتسجيل فيه عبر أسمك ورقم جوالك فهذا يعني موافقتك الكاملة على شروط وسياسة و\" موقع كود كار للسيارات \"</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong>وأنك مسؤول مسؤولية كاملة عن صحة المعلومات التي ادخلتها وأنها غير وهمية او زائفة ويحق لـ \" موقع كود كار \" تقيد وصولك الى حسابك والدخول اليه وحذف جميع المحتوى المتعلق بحساب المستخدم أن تبين لنا غير ذلك . او ان قمت باستخدام حسابك والموقع للأغراض التالية.</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong><code>1-</code>استخدام الموقع من أجل ارتكاب جرم أو تشجيع الآخرين على التورط في أي تصرف قد يعد جريمة أو ينطوي على مسؤولية مدنية أو تجارية. </strong></h6>\r\n<h6 style=\"text-align: center;\"><strong><code>2-</code>استخدام الموقع من أجل انتحال شخصيات أو أطراف أخرى .</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong><code>3-</code>استخدام الموقع لتحميل أي مادة فيها برامج تحتوي على فيروسات، أو \"أحصنة طروادة\"، أو أي شفرات حاسوبية أو ملفات أو برامج قد تعمل على تغيير أو إتلاف أو إعاقة عمل الموقع أو أي جهاز أو برنامج عائد إلى أي شخص يدخل إلى الموقع</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong><code>4-</code>الادعاء بالارتباط مع، أو تمثيل أي شركة أو جمعية أو هيئة من دون أن تكون مخولاً بادعاء تلك العلاقة.</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong><code>5-</code>تغيير أو إتلاف أو شطب أي محتوى على الموقع .</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong><code>6-</code>الإعلانات الأخرى التي لا تتفق مع سياسة الموقع مثل الترويج لبضاعة غير منتج السيارات الجديدة والمستعملة</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong><code>7-</code>الإعلانات الوهمية او الزائفة التي تستخدم للاحتيال الإلكتروني او لتحويل الأموال لأشخاص وهميين.</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong><code>8-</code>الإعلانات الدولية عن سيارات موجودة خارج المملكة العربية السعودية .</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong><code>9-</code> يلتزم العضو والمستخدم \" لموقع كود كار \" بعدم مشاركة بينات حسابه مع أشخاص أخرين .</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong><code>10- </code>يلتزم العضو أو المستخدم \" لموقع كود كار \" أن الصور المضافة للسلعة هي لنفس السلعة المعلن عنها .</strong></h6>\r\n<h3 style=\"text-align: center;\"><strong><code>( نشر الإعلانات )</code></strong></h3>\r\n<h6 style=\"text-align: center;\"><strong>أن جميع الإعلانات المضافة على \"موقع كود كار \" هي مسؤولية الأعضاء المسجلين والمستخدمين للموقع بشكل كامل</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong>وأن\" موقع كود كار \" لا يتحمل أي مسؤولية على المحتوى المضاف المخالف لسياسة الموقع . وأن \"موقع كود كار \"</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong>يقوم بدور رقابي قدر المستطاع للمحتوى الموجود على موقعها والتأكد من ناشري المحتوى وحقيقته وأن تبين لنا مخالفة الشروط يتم تقيد الحساب وعدم القدرة الوصول اليه ودون الأخطار بذلك مسبقاً </strong></h6>\r\n<h6 style=\"text-align: center;\"><strong>للأعضاء أو المستخدمين لسياسة المحتوى والإعلان.</strong></h6>\r\n<h3 style=\"text-align: center;\"><strong><code> ( توصيل الخدمة للعملاء )</code></strong></h3>\r\n<h6 style=\"text-align: center;\"><strong>يتم اخبار العملاء على طلبات تمويل السيارات ( بالقبول او الرفض لطلبهم ) عن طريق رقم الجوال او عن طريق الايميل المسجل أن وجد وعن طريق حسابه بالموقع</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong>( الإشعارات ) الخاص بكل عميل </strong></h6>\r\n<h3 style=\"text-align: center;\"><strong><code>( سياسة الإلغاء )</code></strong></h3>\r\n<h6 style=\"text-align: center;\"><strong>\" موقع كود كار \" هو وسيط رقمي لخدمة تمويل السيارات . وينحصر عمله بالحصول على موافقة جهات التمويل المناسبة للعميل. ويحق لكل عميل قام برفع طلب تمويل تأجيري للحصول على سيارة أن يتراجع عن طلبه او الغائه قبل توقيع العقود او اصدار اللوحات للسيارة المطلوبة برقم طلب التمويل.</strong></h6>\r\n<h3 style=\"text-align: center;\"><strong><code>الإعلانات الممنوعة من النشر.</code></strong></h3>\r\n<h6 style=\"text-align: center;\"><strong>- جميع الإعلانات التي لاتخص بيع او شراء السيارات</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong>- جميع الإعلانات غير مكتملة التفاصيل والأسعار والصور</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong>- إعلان لايحتوي على صور ذات جودة جيدة او متعلق بالسيارات</strong></h6>\r\n<h3 style=\"text-align: center;\"><strong><code>( إخلاء المسؤولية )</code></strong></h3>\r\n<h6 style=\"text-align: center;\"><strong>\" موقع كود كار \" وسيط بين العميل وجهات التمويل فقط. وليس طرفاً في أي اتفاقيات موقعة بين العملاء وجهات التمويل وهو غير مسؤول نهائياً عن أي تبعات أو  خلافات تنتج عن ذلك الاتفاق بين الطرفين من تحويلات مالية او شراء خارج الموقع بين</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong> ( العميل وجهة التمويل )</strong></h6>\r\n<h3 style=\"text-align: center;\"><strong><code>( التواصل مع إدارة الموقع )</code></strong></h3>\r\n<h6 style=\"text-align: center;\"><strong>يمكنك التواصل مع أدارة :\" موقع كود كار \" بكل الأوقات عبر وسائل تواصل تم توفيرها لك .</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong>* عن طريق الرقم الموحد</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong>920009183</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong>* البريد الرسمي للموقع  </strong></h6>\r\n<h6 style=\"text-align: center;\"><strong><a href=\"mailto:info@codecar.com.sa\">info@codecar.com.sa</a> </strong></h6>\r\n<h6 style=\"text-align: center;\"><strong>* أو عن طريق الهاتف  </strong></h6>\r\n<h6 style=\"text-align: center;\"><strong>0504650777 – 0502475777</strong></h6>\r\n<h3 style=\"text-align: center;\"><strong><code>( إشعار أخلاء المسؤولية عن الموقع )</code></strong></h3>\r\n<h6 style=\"text-align: center;\"><strong>- أن \" موقع كود كار \" لا يتحمل أي مسؤولية أو أي عارض، أو أحداث تقع عند تصفحكم لهذا الموقع </strong></h6>\r\n<h6 style=\"text-align: center;\"><strong>- أية أضرار تلحق بأجهزة المستخدم أثناء استخدام أو نتيجة عدم القدرة على استخدام الموقع</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong>مستوى دقة محتويات المواقع التي ترتبط بالموقع من حيث الاكتمال أو الحداثة، أو الخلو من الأخطاء اللغوية، أو المطبعية، أو غيرها، أو انقطاع المعلومات، أو توقفها لأي سبب كان، سواء فني، أو طارئ، أو مُتعمد .</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong>- أية رسائل، أو روابط، أو مؤشرات، أو نصائح مشبوهة يتم التعامل معها من قبل الأعضاء والمستخدمين للموقع.</strong></h6>\r\n<p style=\"text-align: center;\"> </p>\r\n<h3 style=\"text-align: center;\"><strong><code>( تنبيهات أمان الاستخدام )</code></strong></h3>\r\n<h6 style=\"text-align: center;\"><strong>*لا يخلى الأمر في المواقع الإلكترونية من إعلانات هدفها الاحتيال عليك . لذا وجب الحرص الشديد على عدم الوقوع في هذه الأساليب وفيما يلي بعضها (مثال لا على الحصر) .</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong>- طلب تحويل أموال قبل رؤية المنتج أو جزء منه (عربون) .</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong>- إعلانات مغرية بأسعار غير عقلانية لقيمة منتج تختلف عن قيمته في السوق .</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong>- استخدام صور الإعلان للمنتج مأخوذة من الإنترنت .</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong>- صيغة الإعلان تكون بأسلوب احتيالي لجذب انتباهك وبأسعار مغرية جداً .</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong>- يقوم المحتالين بالتهرب من رؤيتك للمنتج او مقابلتك والتحجج أنهم في مدينة بعيدة جداً .</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong>- اطلب أوراق ثبوتية من المعلن أنه مالك السلعة وقم بفحص المنتج للتأكد من سلامته .</strong></h6>\r\n<h3 style=\"text-align: center;\"><strong><code>( حقوق المحتوى )</code></strong></h3>\r\n<h6 style=\"text-align: center;\"><strong>أن جميع المحتوى الموجود على \"موقع كود كار\" من تصاميم او إعلانات وصور وصوت</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong> وشعارات وبرمجيات هي ملك \"موقع كود كار \" حصراً ومحمية بموجب القانون السعودي للتجارة</strong></h6>\r\n<h6 style=\"text-align: center;\"><strong> ولا يحق لأي جهة كانت أن تقوم بنسخ أو تقليد أو استخدام لأي محتوى موجود مهما  </strong></h6>\r\n<h6 style=\"text-align: center;\"><strong>كان تحت طائلة المسائلة القانونية</strong></h6>\r\n<p style=\"text-align: center;\"><code><strong>               www.codecar.com.sa                  </strong></code></p>', '2024-03-10 00:54:20', '2024-07-13 17:34:15'),
