(67, 'about_us_description_ar', '- منصة و موقع \" كود كار \" بدأ انطلاقها في عام 2023  لتكون استراتيجية ذكية تصل للجميع بطرق حديثة ومتطورة لنوصل اليك ماتبحث عنه بكل سهولة وبأسرع وقت .\r\n\r\n- منصة و موقع \" كود كار \" تتميز عن غيرها أنها قامت بتوفير لك كل ماتحتاج اليه في عالم السيارات من بيع وشراء وتمويل السيارات مع جهات تمويل معروفة من بنوك وشركات تمويل السيارات .\r\n\r\n- منصة و موقع \" كود كار \" وفرت لك خدمة تمويل السيارة وجمعت لك جميع عروض البنوك وشركات التمويل بمكان واحد لتختار مايناسبك بلحظات دون عناء البحث لوقت طويل .\r\n\r\n- حراج كامل متوفر فيه جميع خدمات الإعلان من صور ومواصفات واسعار وعروض حصرية واسعار منافسة لجميع الماركات .', '2024-03-10 00:54:20', '2024-07-13 17:34:15'),
(68, 'about_us_description_en', 'The “Code Car” platform and website began its launch in 2023 to be a smart strategy that reaches everyone in modern and advanced ways to deliver to you what you are looking for with ease and in the fastest time.\r\n\r\nThe “Code Car” platform and website is distinguished from others in that it provides you with everything you need in the world of cars, including buying, selling, and financing cars with well-known financing agencies, including banks and car financing companies.\r\n\r\nThe “Code Car” platform and website provided you with a car financing service and collected for you all the offers of banks and financing companies in one place so that you can choose what suits you in moments without the hassle of searching for a long time.\r\n\r\n- A complete garage that includes all advertising services, including pictures, specifications, prices, exclusive offers, and competitive prices for all brands.', '2024-03-10 00:54:20', '2024-07-13 17:34:15'),
(69, 'about_us_card_left_ar', 'حلول تمويلية فريدة هي ما يميزنا، نقدم لك حلاً متخصصاً يلبي احتياجاتك في عالم السيارات.', '2024-03-10 00:54:20', '2024-07-13 17:34:15'),
(70, 'about_us_card_left_en', 'Unique financing solutions are what distinguishes us. We offer you a specialized solution that meets your needs in the world of cars.', '2024-03-10 00:54:20', '2024-07-13 17:34:15'),
(71, 'about_us_card_right_ar', 'نسعي لتقديم خدمات فائقة المستوى وتجربة فريدة، لتحقيق تطلعات عشاق السيارات بكفاءة وراحة.', '2024-03-10 00:54:20', '2024-07-13 17:34:15'),
(72, 'about_us_card_right_en', 'We strive to provide superior services and a unique experience, to fulfill the aspirations of car enthusiasts efficiently and comfortably.', '2024-03-10 00:54:20', '2024-07-13 17:34:15'),
(73, 'address', 'معارض القادسية - شارع -وادي اللجام - كود كار للسيارات', '2024-03-10 00:54:20', '2024-07-13 17:34:15'),
